import React from 'react';
import '../App.css';
import { ArticlesData } from './ArticlesData';
import './ArticlesPreview.css';

function ArticlesPreview({articles}) {
  return (
    <div className="articles-container">
        <div className="articles-words">
            READ THE LATEST ARTICLES
        </div>
        {ArticlesData.map((article, index) => {
            return(
            <div className={index === 0 ? 'large-container' : 'small-container'}>
                <img src={article.image} alt="" className={index === 0 ? 'large' : 'small'} />
                <p className="image-alt"></p>
            </div>
            )
        })}
    </div>
  )
}

export default ArticlesPreview
